                <div className="container-fluid">

                    <div className="row">

                        <div className="col-10 mx-auto">

                            <div className="col-6 pt-5 pt-lg-0">

                            </div>

                        </div>

                    </div>

                </div>

            </section>

        </>

    );

}

export default  Home;
